import numpy as np
import time
t0=0
t02=0
t03=0
error_i=0
ref_r = 0
ref_mu = 0
cmd_actualizado = False
ref_v = 0

def callback(msg:State):
    global s,x,y,par,delta,t0,t02,circuito,x_msg,ref_r,cmd_actualizado, ref_v
    dx=np.array(x)-msg.x
    dy=np.array(y)-msg.y
    dist = [np.linalg.norm([dx[i],dy[i]]) for i in range(len(x))]
    i=np.argmin(dist)

    recta=(y[i+1]-y[i])/(x[i+1]-x[i])*(msg.x-x[i])+y[i]-msg.y
    signo_d=np.sign(recta)*np.sign(x[i]-x[i+1])

    d_min=np.min(dist)*signo_d

    s[i]
    corrected_yaw = (msg.yaw+np.pi)%(2*np.pi) - np.pi
    theta = np.arctan2(y[(i+5)%len(x)]-y[i],x[(i+5)%len(x)]-x[i])
    phi = corrected_yaw - theta
    phi_corrected = corrected_yaw - theta if np.abs(phi)<2 else (phi-2*np.pi if phi>0 else phi+2*np.pi)

    if time.time()-t02 >= 5:
        circuito_pub.publish(circuito)
        t02=time.time()

    x_msg = Float32MultiArray()
    # x_msg.data = [s[i],d_min,phi_corrected,msg.vx,msg.vy,msg.r,par,delta]
    x_msg.data = [s[i],d_min,phi_corrected,msg.vx,par,delta]

    if time.time()-t0>= 0.045:
      x_pub.publish(x_msg)
      cmd_actualizado = False
    #   rospy.loginfo(x_msg)
      t0=time.time()
    elif cmd_actualizado:
        # PI_low_level(ref_r,x_msg.data[5],delta)
        ref_r = x_msg.data[3]*np.tan(delta)/1.535
        PI_low_level(ref_r,ref_v,msg.r,msg.vx,delta) 
        cmd_actualizado = False


def callback2(msg:Cmd):
    global par,delta,cmd_actualizado
    par = msg.dc
    delta = msg.delta
    cmd_actualizado = True

def transformation_curv(msg:Float32MultiArray):
    pred_transformada = Float32MultiArray()
    for i in range(0,len(msg.data),2):
        x_msg, y_msg = transforma(msg.data[i],msg.data[i+1])
        pred_transformada.data.append(x_msg)
        pred_transformada.data.append(y_msg)

    pred_pub.publish(pred_transformada)

def transforma(smsg,mumsg):
    global s,x,y, ref_mu
    
    res = [(s[i]-smsg)**2 for i in range(len(s))]
    ind = np.argmin(res)
    theta = np.arctan2(y[(ind+5)%len(x)]-y[ind],x[(ind+5)%len(x)]-x[ind])
    x_msg = x[ind] - mumsg*np.sin(theta)
    y_msg = y[ind] + mumsg*np.cos(theta)

    ref_mu = mumsg

    return x_msg, y_msg


def ref_gen(msg:Float32):
    global ref_v
    ref_v = msg.data
    
def PI_low_level(ref_r,ref_v,r_actual,v_actual,delta):
    global par, t03, error_i
    error= ref_r - r_actual
    error_v = ref_v - v_actual
    # print(error)
    # if error_i<1:
    #     error_i += error*(time.time()-t03)
    # else:
    #     error_i = 0

    if error==error:
        # t03 = time.time()
        delta += 0 #0.03*error #-0.1*error_i #- 1.5*(x_msg.data[1]-ref_mu)
        par += 0*error_v
        cmd = Controls()
        cmd.accelerator = par
        cmd.steering = delta*180/np.pi
        low_level_pub.publish(cmd)
    else:
        error_i = 0
        error = 0




